import Vue from 'vue'
import App from './App.vue'
import vuetify from './plugins/vuetify'
import loadScript from 'vue-plugin-load-script';

//Vue.use(loadScript);

Vue.loadScript("file.js").then(() => {
  console.log("SUCESS")
}).catch(() => {
  console.log("FAILED")
})

Vue.config.productionTip = false

new Vue({
  vuetify,
  loadScript,
  render: h => h(App)
}).$mount('#app')
